  \"2015-09-01T18:07:10.938221\",\n\t\"name\": \"auction-sale-data\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"This dataset contains sale data information
  for Agency reported items sold via GSA Auctions&reg; Sales.  The data is for closed
  sales during FY2009.  GSA Auctions&reg; offers the public the opportunity to bid
  electronically on a wide array of Federal assets. The auctions are completely web-enabled,
  allowing all registered participants to bid on a single item or multiple items (lots)
  within specified timeframes.  GSA Auctions&reg; sale items include communications,
  computer, electric, electronic, agricultural, office, photographic, marine, laboratory,
  medical, dental and veterinary supplies and equipment; trailers, tractors, bicycles
  and salvage/scrap vehicles; furniture, household and personal items, industrial
  machinery, jewelry and collectibles.  GSA Auctions&reg; is accessible at http://www.gsaauctions.gov.
  Unregistered users may browse the site. Registration is required for bidders.\",\n\t\"license_title\":
